syntax = "proto2";

package FBRegisterUserResult;

option objc_class_prefix = "ProtobufFBRegisterUser";
option java_outer_classname = "FBRegisterUserResult";
option java_package = "com.zillow.mobile.webservices";

message Result {
    required int32 apiVersion = 1;
    required int32 responseCode = 2;
    optional string responseMessage = 3;
    optional string zuid = 4;
}
